package javaLearn;

public class Mtr_Impossition {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		for(int times=0;times<=20;times++) {
         System.out.println("Nayan have repeatly acting at 20 times");
		}
		int times=0;
		while (times<25) {
			System.out.println("Keerthi suresh have repeatly acting at 25 times");
			times++;
			
		}
		do {
			System.out.println("Anshika have repeatly acting at 50 times");
			times++;
			
		} while (times<50);
		
	}
	

}
